import React, { useState } from 'react';
import './index.css';
function App(){
   
    const [num,set]=useState("");
    const [full,set2]=useState([]);
    function add(){
        set2((ashu)=>{
            return [...ashu,num];
        });
    }
    function text(event){
        set(event.target.value);
    }
    
    return(
        <>
        <div className='cover'>
            <br/>
            <h2>ToDO List</h2>
            <br/>
            <form className='input'><input type="text" placeholder='Add a items' onChange={text}/><button type="submit" className='button' onClick={add}>+</button></form>
            <br/>
            <ol>
            {full.map((old)=>{
                return <li>{old}</li>
            })}
            </ol>
        </div>
        </>
    );
}

export default App;
